import React from 'react';
import { useNavigate } from 'react-router-dom';

const navigate = useNavigate();

const MainPage = () => {
  return (
    <header className="App-header">
      <h1>Counter</h1>
      <button onClick={navigate("/counter")}> Click me! </button>
    </header>
  );
};
export default MainPage;
